  return(
    <Grid.Column>
      <h1>"Posts"</h1>
      <iframe width="380"
      height="157"
      src="https://www.youtube.com/embed/Rp8WL621uGM"
      frameborder="0"
      allow="autoplay; encrypted-media"
      allowfullscreen></iframe>
    </Grid.Column>
  )


}



export default Posts;
